import React,{useState} from 'react';
import { AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';
import {  Button, Dialog, DialogTitle, DialogContent, DialogActions } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const OptTable = ({ columnDefs, rowData, height,tval,tval90,tval110 }) => {

  const useStyles = makeStyles((theme) => ({
    dialogContainer: {
      borderRadius: theme.spacing(2),
      padding: theme.spacing(2),
    },
    dialogTitle: {
      paddingBottom: theme.spacing(1),
    },
    dialogContent: {
      paddingTop: 0,
      paddingBottom: theme.spacing(2),
    },
  }));
  const [open, setOpen] = useState(false);
  const classes = useStyles();
  const handleClose = () => {
    setOpen(false); // Close the dialog
  };
  const handleT =()=>{
    setOpen(true);
  }
  return (
    <div className="ag-theme-alpine" style={{ height: height, width: '100%' }}>
      {console.log(rowData)}
      <AgGridReact
        columnDefs={columnDefs}
        rowData={rowData}
        defaultColDef={{
          flex: 1,
          resizable: true,
          filter: true,
          sortable: true,
          editable: true,
        }}
      ></AgGridReact>
      <Dialog open={open} onClose={handleClose} maxWidth="xs" fullWidth>
            <div className={classes.dialogContainer}>
              <DialogTitle className={classes.dialogTitle}>Optimization Result</DialogTitle>
              <DialogContent className={classes.dialogContent}>
                <p>t value: {tval}</p>
                <p>t value (90%): {tval90}</p>
                <p>t value (110%): {tval110}</p>
              </DialogContent>
              <DialogActions>
                <Button onClick={handleClose} color="primary">
                  Close
                </Button>
              </DialogActions>
            </div>
          </Dialog>
          <Button variant={'contained'} onClick={handleT}>Submit</Button>
    </div>
  );
};

export default OptTable;
